pragma solidity ^0.4.23;

import './Stage1.sol';
// import './Stage2.sol';
//import './Stage3.sol';

contract Voting is
  Stage1/*,
  /*Stage2/*,
  Stage3*/
{
  using SafeMath for uint256;

  constructor(bytes32[] proposalsNames)
    Stage1(
      'Blockchain Developers Moldova', // name
      'https://www.facebook.com/groups/592057231174722', // website
      'https://avatars3.githubusercontent.com/u/38734481', // logo
      proposalsNames // available proposals
    )
    // Stage2(
    //   1525132800, // start time
    //   1527811200 // end time
    // )
    public
  {
      // @todo your code
  }

  /** Stage 1 */

  function getProposals() view public returns (bytes32[]) {
      bytes32[] memory names = new bytes32[](proposals.length);
      for (uint256 i = 0; i < proposals.length; i++) {
        names[i] = proposals[i].name;
      }
      return names;
  }

  function vote(bytes32 proposal) public {
    
    Proposal storage p = proposals[getProposalRef(proposal)];
    Voter storage voter = voters[msg.sender];
    require(!voter.voted);

    emit Voted(msg.sender, proposal);
    
    voter.voted = true;
    voter.vote = proposal;

    p.voteCount++;

    totalVoteCount++;
  }

  function hasVoted(address voter) view public returns (bool) {
    Voter memory v = voters[voter];
    return v.voted;
  }

  function getVote(address voter) view public returns (bytes32) {
    Voter memory v = voters[voter];
    require(v.voted);
    return v.vote;
  }

  function getProposalVoteCount(bytes32 proposal) view public returns (uint256) {
    return totalVoteCount;
  }

  function getLeader() view public returns (bytes32) {
    bytes32 max;
    uint256 maxNr = 0;
    for (var i = 0; i < proposals.length; i++) {
      if (maxNr < proposals[i].voteCount) {
        maxNr = proposals[i].voteCount;
        max = proposals[i].name;
      }
    }
    return max;
  }

  /** Stage 2 */

